import React from 'react';
import './comp3.css';

const Component3 = (props) => {
  const { changeId } = props;

  const prevComponent = () => {
    changeId(2);
  };

  const nextComponent = () => {
    changeId(4);
  };

  return (
    <div className="component3">
      <h2>Do you own own or manage an inventory of goods and services?</h2>
      <br />
      <div className="button-group">
        <button className="option-button yes" onClick={nextComponent}>
          Yes
        </button>
        <button className="option-button no" onClick={nextComponent}>
          No
        </button>
      </div>
      <button className="prev-button" onClick={prevComponent}>Previous</button>
      <button className="save-button" onClick={nextComponent}>Save and Proceed</button>
    </div>
  );
};

export default Component3;
